import React, { Component } from "react";

import './style.scss';

class MainView extends Component {
  render() {
    return (
    <div className="main-view">
      <div className="wrapper">
        <div className="menu-bar">
          <div className="left-items">
            <span>PRODUCTS</span>
            <span>SOLUTIONS</span>
            <span>SUPPORT</span>
            <span>COMPANY</span>
          </div>
          <div className="logo">cadence</div>
          <div className="right-items"></div>
          <div></div>
        </div>
        <div className="banner">
          <img className="banner-image" alt="img" src={require("../../assets/imgs/Cadence_Homepage 1@3x.png")}></img>
        </div>
      </div>

    </div>)
    ;
  }
}

export default MainView;
